INSERT INTO `evaluacion_tabla_reactivo` VALUES (1,'La imagen de inicio representa el contenido del recurso','2016-04-05 13:19:52','2018-05-08 16:26:26'),(2,'En la introducción o bienvenida se menciona al Instituto Politécnico Nacional.','2016-04-05 13:19:53','2018-05-08 16:26:26'),(3,'En la introducción o bienvenida se menciona la carrera o unidad de aprendizaje a la que pertenece el recurso.','2016-04-05 13:19:53','2018-05-08 16:26:26'),(4,'En la introducción o bienvenida se mencionan las ventajas que el recurso le proporciona al estudiante para su formación.','2016-04-05 13:19:54','2018-05-08 16:26:26'),(5,'En la introducción o bienvenida se describe con claridad su propósito, por qué se eligieron esos contenidos y si es el caso, el tipo de manejo o dominio que se obtendrá de algunos procedimientos y/o herramientas.','2016-04-05 13:19:54','2018-05-08 16:26:26'),(6,'En la introducción o bienvenida se motiva al estudiante, de tal forma que logra captar su interés y promueve el deseo de aprender.','2016-04-05 13:19:54','2018-05-08 16:26:26'),(7,'En la introducción o bienvenida se presenta el nombre completo del recurso, tal y como aparece en el oficio y la cédula de solicitud.','2016-04-05 13:19:54','2018-05-08 16:26:26'),(8,'Se hace mención de la Competencia general y de las Competencias particulares que el usuario desarrollará con el recurso.','2016-04-05 13:19:55','2018-05-08 16:26:26'),(9,'Las competencias dejan claro los conocimientos, habilidades, actitudes y valores que el estudiante adquirirá, así como las acciones que realizará con éstos.','2016-04-05 13:19:55','2018-05-08 16:26:26'),(10,'Las competencias se identifican y expresan de manera clara.','2016-04-05 13:19:55','2018-05-08 16:26:26'),(11,'Las competencias pueden ser alcanzadas con base en las estrategias didácticas, la extensión y la modalidad del recurso.','2016-04-05 13:19:55','2018-05-08 16:26:26'),(12,'Las competencias están formuladas colocando en el centro de la actividad al estudiante y no al docente y destacando lo que el alumno debe ser capaz de realizar como resultado del proceso de aprendizaje.','2016-04-05 13:19:56','2018-05-08 16:26:26'),(13,'Las competencias se encuentran identificadas con los siguientes títulos: Competencia general y Competencias particulares.','2016-04-05 13:19:56','2018-05-08 16:26:26'),(14,'Responde, con claridad y de una manera descriptiva, a la pregunta \"¿cómo se va a trabajar?\", de tal modo que quedan claras las etapas o fases para el desarrollo de las competencias. ','2016-04-05 13:19:56','2018-05-08 16:26:26'),(15,'Se especifica si el uso del recurso didáctico será de apoyo, opcional u obligatorio para los estudiantes.','2016-04-05 13:19:56','2018-05-08 16:26:26'),(16,'Se indica si las actividades de aprendizaje se realizarán en el aula de manera presencial o bien, las desarrollarán de manera individual o por grupos, en horario fuera de clase.','2016-04-05 13:19:56','2018-05-08 16:26:26'),(17,'Se hace referencia a los momentos  y tipos de evaluación (diagnóstica, formativa, sumativa e integradora) con los que se valorarán las actividades realizadas y se verificará el nivel de dominio alcanzado de la competencia.','2016-04-05 13:19:57','2018-05-08 16:26:26'),(18,'Se presenta de manera clara el conjunto de recursos sugeridos de los que el estudiante deberá disponer y utilizar.','2016-04-05 13:19:57','2018-05-08 16:26:26'),(19,'Se enuncia la estructura de los contenidos del recurso (por módulos, capítulos, unidades, temas, subtemas).','2016-04-05 13:19:57','2018-05-08 16:26:26'),(20,'Se explican los diferentes tipos de actividades que debe realizar el alumno (trabajo teórico y/o práctico) para remplazar el laboratorio o taller en el ambiente virtual.','2016-04-05 13:19:57','2018-05-08 16:26:26'),(21,'Los contenidos y las actividades a lo largo del recurso son congruentes con la metodología.','2016-04-05 13:19:57','2018-05-08 16:26:26'),(22,'La forma de trabajo descrita es pertinente con la modalidad en la que se utilizará el recurso.','2016-04-05 13:19:58','2018-05-08 16:26:26'),(23,'Especifica el número de horas de estudio por semana. ','2016-04-05 13:19:58','2018-05-08 16:26:26'),(24,'La ubicación de las actividades corresponde con su ubicación real en el recurso.','2016-04-05 13:19:58','2018-05-08 16:26:26'),(25,'La distribución de las actividades a lo largo del período de duración del recurso, resulta pertinente para su realización y entrega.','2016-04-05 13:19:58','2018-05-08 16:26:26'),(26,'Los tipos de actividades se distinguen de la siguiente manera: actividad diagnóstica, actividades de aprendizaje, actividades integradoras y actividad de recuperación','2016-04-05 13:19:58','2018-05-08 16:26:26'),(27,'La agenda de actividades se encuentra en formato PDF y puede imprimirse.','2016-04-05 13:19:58','2018-05-08 16:26:26'),(28,'La organización de los datos que corresponden a este apartado incluye la siguiente información: unidad didáctica, tema o equivalente (encabezado), nombre y tipo de actividad, evidencia de aprendizaje y período en el que deberá entregarse.','2016-04-05 13:19:59','2018-05-08 16:26:26'),(29,'La numeración de las actividades es secuencial, con números arábigos, sin importar el tipo de actividad.','2016-04-05 13:19:59','2018-05-08 16:26:26'),(30,'El nombre y número de las actividades coincide con la agenda de actividades, contenidos, tabla de evaluación y demás secciones donde aparezcan.','2016-04-05 13:19:59','2018-05-08 16:26:26'),(31,'Incluye una introducción que presenta el recurso y su relación con un tema, unidad, disciplina o carrera.','2016-04-05 13:19:59','2018-05-08 16:26:26'),(32,'La introducción explica la finalidad del recurso, sin ser tan específica como la metodología.','2016-04-05 13:20:00','2018-05-08 16:26:26'),(33,'Responde de una manera descriptiva a las preguntas: ¿Qué aprenderé con este recurso? ¿Para qué quiero aprender eso? ¿Qué tengo que hacer para aprender? ¿Cómo me evaluarán? ¿A quién puedo acudir para solicitar ayuda?','2016-04-05 13:20:00','2018-05-08 16:26:26'),(34,'La respuesta a la pregunta ¿qué aprenderé con este recurso? es congruente con los contenidos y la competencia general.','2016-04-05 13:20:00','2018-05-08 16:26:26'),(35,'La respuesta a la pregunta ¿para qué quiero aprender eso?, explica con claridad la importancia del recurso para la vida profesional y cotidiana del estudiante.','2016-04-05 13:20:00','2018-05-08 16:26:26'),(36,'La respuesta a la pregunta: ¿qué tengo que hacer para aprender? describe con claridad la manera en la que va a  trabajar el estudiante.','2016-04-05 13:20:00','2018-05-08 16:26:26'),(37,'La respuesta a la pregunta: ¿qué tengo que hacer para aprender? indica la manera en la que trabajará el estudiante y se relaciona con la metodología planteada en el recurso.','2016-04-05 13:20:00','2018-05-08 16:26:26'),(38,'La respuesta a la pregunta: ¿qué tengo que hacer para aprender? se ofrece al estudiante una panorámica sobre recomendaciones o estrategias en las que se puede apoyar para alcanzar las competencias esperadas. ','2016-04-05 13:20:01','2018-05-08 16:26:26'),(39,'La respuesta a la pregunta: ¿qué tengo que hacer para aprender? describe con claridad las acciones que tendrán que realizar los estudiantes.','2016-04-05 13:20:01','2018-05-08 16:26:26'),(40,'La respuesta a la pregunta: ¿qué tengo que hacer para aprender?  proporciona los elementos suficientes para que el estudiante tome decisiones a lo largo del curso o recurso.','2016-04-05 13:20:01','2018-05-08 16:26:26'),(41,'La respuesta a la pregunta ¿cómo me evaluarán? incluye la ponderación de cada actividad integradora y ésta coincide con la tabla de evaluación.','2016-04-05 13:20:01','2018-05-08 16:26:26'),(42,'La respuesta a la pregunta ¿a quién puedo acudir para solicitar ayuda? Menciona las diferentes figuras a las cuales puede acudir el alumno durante su proceso de aprendizaje.','2016-04-05 13:20:01','2018-05-08 16:26:26'),(43,'La ubicación de las actividades corresponde con su ubicación real en los 