'La actividad de recuperación se presenta como una actividad independiente (no seriada). ','2016-04-05 13:20:13','2018-05-08 16:26:26'),(122,'En los cuestionarios de opciones se explica al usuario cuántas preguntas integran la evaluación.','2016-04-05 13:20:13','2018-05-08 16:26:26'),(123,'En los cuestionarios de opciones se menciona el puntaje por pregunta.','2016-04-05 13:20:13','2018-05-08 16:26:26'),(124,'En los cuestionarios de opciones se menciona el número de intentos para resolver la evaluación.','2016-04-05 13:20:13','2018-05-08 16:26:26'),(125,'En los cuestionarios de opciones, se especifican los criterios de penalización y de registro de calificación','2016-04-05 13:20:13','2018-05-08 16:26:26'),(126,'La instrucción para nombrar el archivo de evidencia es congruente con el número de actividad y tiene una nomenclatura uniforme: apellidopaterno_materno_nombre(s)_act#','2016-04-05 13:20:14','2018-05-08 16:26:26'),(127,'Las actividades diagnósticas y de aprendizaje no tienen puntuación.','2016-04-05 13:20:14','2018-05-08 16:26:26'),(128,'El recurso favorece la comprensión y el aprendizaje en la modalidad en la que se impartirá.','2016-04-05 13:20:14','2018-05-08 16:26:26'),(129,'El usuario tiene la posibilidad de realizar actividades e incidir sobre el comportamiento del recurso educativo (interacción alumno-recurso).','2016-04-05 13:20:14','2018-05-08 16:26:26'),(130,'El uso de las animaciones y demás recursos interactivos se justifica en situaciones donde se requiere la intervención del usuario en un ambiente que implique movimiento, con el objeto de observar un resultado específico producido por su interacción. ','2016-04-05 13:20:14','2018-05-08 16:26:26'),(131,'Existe un ambiente para intercambiar puntos de vista o información ya sea en forma sincrónica o asincrónica (interacción alumno-alumno).','2016-04-05 13:20:14','2018-05-08 16:26:26'),(132,'El profesor y los alumnos se encontrarán intercambiando información, traducida en conocimiento, lo cual implica estar en constante comunicación, que puede ser sincrónica y/o asincrónica (interacción alumno-profesor).','2016-04-05 13:20:14','2018-05-08 16:26:26'),(133,'El recurso incluye y explica los medios y mecanismos a utilizar en las consultas y asesorías virtuales, así como el funcionamiento de los medios para el efecto, tales como: aulas virtuales, calendario, tablero de anuncios, foros, e-mail, chat, videoconferencia, etc.','2016-04-05 13:20:15','2018-05-08 16:26:26'),(134,'Se incluyen los nombres de los autores y la fecha de la última actualización del recurso.','2016-04-05 13:20:15','2018-05-08 16:26:26'),(135,'Las imágenes de la identidad gráfica son consistentes con el contenido.','2016-04-05 13:20:15','2018-05-08 16:26:26'),(136,'Los títulos, subtítulos e incisos se identifican con facilidad y están alineados a la izquierda, o centrados en el caso de documentos adjuntos. ','2016-04-05 13:20:15','2018-05-08 16:26:26'),(137,'Los títulos, subtítulos e incisos se encuentran sin punto final. ','2016-04-05 13:20:15','2018-05-08 16:26:26'),(138,'Las ideas y los párrafos están redactados de manera clara y hay una relación lógica entre ambos (coherencia comunicativa).','2016-04-05 13:20:15','2018-05-08 16:26:26'),(139,'Todos los párrafos de más de dos renglones están justificados, excepto por títulos, frases o texto resaltado, instrucciones y pies de imagen.','2016-04-05 13:20:15','2018-05-08 16:26:26'),(140,'Los recursos multimedia son coherentes con las explicaciones presentadas en su contenido.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(141,'Los recursos multimedia provenientes de sitios o plataformas de Internet como: YouTube, Prezzi, SlideShare, blogs, entre otros, están publicados desde una cuenta de usuario del plantel.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(142,'Los contenidos de Internet incluyen referencias de su origen real, no de su ubicación en la página o cuenta del autor.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(143,'Las imágenes, tablas, animaciones y videos no tienen fondos que compiten visualmente con el texto o contenido, textos encimados o contrastes que dificultan la lectura o comprensión del contenido principal.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(144,'Los recursos que incluyen audio cuentan con una dicción correcta, nítida y sin distorsión.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(145,'Existe una clara distinción de sonidos de apoyo y éstos permiten escuchar distintivamente la voz del narrador, la nitidez de la grabación o transmisión, según el caso.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(146,'Cuando una animación o presentación PowerPoint contiene audio, se indica mediante una instrucción de texto o con un icono.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(147,'Los recursos multimedia que implican interacción por parte del usuario, cuentan con instrucciones claras y coherentes con el funcionamiento de éstos.','2016-04-05 13:20:16','2018-05-08 16:26:26'),(148,'Los recursos multimedia que se presentan en la plataforma son de autoría propia, desarrollados exclusivamente para el recurso. ','2016-04-05 13:20:17','2018-05-08 16:26:26'),(149,'No se incluyen archivos con Derechos de Autor. Cuando se trata de documentos libres de derechos se muestra la información de donde fueron obtenidos con los datos de los respectivos autores (referencia).','2016-04-05 13:20:17','2018-05-08 16:26:26'),(150,'El uso que se hace de textos copiados de páginas de Internet corresponde a citas textuales breves que sirven de apoyo al contenido inédito (de autoría propia), desarrollado exclusivamente para el recurso. ','2016-04-05 13:20:17','2018-05-08 16:26:26'),(151,'En el uso de recursos e información para consulta en Internet (por ejemplo: conceptos y definiciones), se utilizan páginas con dominios de instituciones educativas o gubernamentales que garantizan el rigor académico cuando se trata de información primordial para la unidad de aprendizaje.','2016-04-05 13:20:17','2018-05-08 16:26:26'),(152,'El uso de dominios .com está reservado para consultas complementarias o para exponer ejemplos que no sustituyen la información esencial del recurso. ','2016-04-05 13:20:17','2018-05-08 16:26:26'),(153,'Las ligas de páginas de Internet que se presentan están disponibles y vigentes.','2016-04-05 13:20:17','2018-05-08 16:26:26'),(154,'Las palabras del glosario están presentes al menos una vez en las actividades o el contenido del recurso.','2016-04-05 13:20:17','2018-05-08 16:26:26'),(155,'Los textos que sirven como enlace para descargar un archivo presentan un nombre coherente, generalmente el título del documento.','2016-04-05 13:20:18','2018-05-08 16:26:26'),(156,'El título del recurso se encuentra con las letras iniciales en mayúsculas y resaltado en negritas.','2016-04-05 13:20:18','2018-05-08 16:26:26'),(157,'Se evita el uso de la arroba para integrar el género femenino y el masculino en una sola palabra. Ejemplo: Bienvenid@s','2016-04-05 13:20:18','2018-05-08 16:26:26'),(158,'Uso limitado de expresiones coloquiales: “¡Enhorabuena!”, “¡Continúa, tú puedes!”, “¡Ánimo, ya estás cerca de la meta!”, “¡Sigue adelante, ya falta poco!”, “¡Gracias por compartir con nosotros esta maravillosa experiencia!”','2016-04-05 13:20:18','2018-05-08 16:26:26'),(159,'Uso correcto de mayúsculas y minúsculas.','2016-04-05 13:20:18','2018-05-08 16:26:26'),(160,'Uso adecuado de tipografía (negritas y cursivas).','2016-04-05 13:20:18','2018-05-08 16:26:26'),(161,'Solamente el hipertexto aparece subrayado.','2016-04-05 13:20:18','2018-05-08 16:26:26'),(162,'Se aplican las reglas de acentuación (incluye acentos diacríticos en pronombres demostrativos).','2016-04-05 13:20:18','2018-05-08 16:26:26'),(163,'Las abreviaturas, siglas y acrónimos están correctamente escritos. ','2016-04-05 13:20:18','2018-05-08 16:26:26'),(164,'Uso correcto y moderado de las preposiciones, locuciones preposicionales y adverbiales.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(165,'Los contenidos están exentos de vicios de lenguaje (anfibología o ambigüedad, cacofonías, dequeísmo, pobreza de lenguaje, etcétera).','2016-04-05 13:20:19','2018-05-08 16:26:26'),(166,'Uso correcto de los signos de puntuación (punto, coma, punto y coma, dos puntos, puntos suspensivos). ','2016-04-05 13:20:19','2018-05-08 16:26:26'),(167,'Uso correcto de signos auxiliares (comillas, guiones, raya, paréntesis, corchetes, admiración, interrogación).','2016-04-05 13:20:19','2018-05-08 16:26:26'),(168,'Hay concordancia gramatical.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(169,'Hay coherencia entre oraciones y párrafos.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(170,'Las estructuras sintácticas y semánticas son correctas.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(171,'El texto está claramente estructurado, es fluido y cuenta con información pertinente y bien organizada, sin contenido ambiguo, redundante y/o incoherente.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(172,'Los párrafos son cortos y concisos (no más de nueve líneas por párrafo), para una adecuada lectura en pantalla.','2016-04-05 13:20:19','2018-05-08 16:26:26'),(173,'Muestra oraciones completas (sin omisión de preposiciones, artículos, verbos, etcétera).','2016-04-05 13:20:20','2018-05-08 16:26:26'),(174,'Uso correcto del participio y el gerundio.','2016-04-05 13:20:20','2018-05-08 16:26:26'),(175,'La palabra clic no se encuentra escrita con k ni con mayúsculas.','2016-04-05 13:20:20','2018-05-08 16:26:26'),(176,'Aclaración respecto al uso de terminología específica de la disciplina, cuando exista.','2016-04-05 13:20:21','2018-05-08 16:26:26'),(177,'El recurso se abre y/o reproduce automáticamente al insertar el CD o DVD en la unidad lectora de la computadora. En su defecto, se indica de antemano el archivo que debe abrirse o ejecutarse para iniciarlo o instalarlo.','2016-04-05 13:20:21','2018-05-08 16:26:26'),(178,'El tiempo máximo de descarga y/o comienzo de la reproducción del recurso es de 30 segundos, ya sea mediante la conexión a Internet o como resultado de la ejecución de una instrucción en la computadora.','2016-04-05 13:20:21','2018-05-08 16:26:26'),(179,'La instalación y desinstalación del recurso es sencilla, rápida y transparente.','2016-04-05 13:20:21','2018-05-08 16:26:26'),(180,'La ejecución del recurso es constante y confiable: no tiene errores de funcionamiento. ','2016-04-05 13:20:21','2018-05-08 16:26:26'),(181,'El recurso se visualiza y funciona correctamente al menos en los siguientes navegadores de Internet: Chrome, Explorer 10+. Si el recurso debe abrirse con algún navegador en particular, se especifica de antemano al usuario.','2016-04-05 13:20:21','2018-05-08 16:26:26'),(182,'El recurso puede abrirse o reproducirse de manera independiente con respecto de una plataforma de computación específica (multiplataforma).','2016-04-05 13:20:22','2018-05-08 16:26:26'),(183,'Existe en todo momento una opción de contenido en formato de texto que cumple esencialmente la misma función o propósito que el contenido visual o auditivo (accesible).','2016-04-05 13:20:22','2018-05-08 16:26:26'),(184,'El recurso cuenta con mecanismos de navegación (barras de navegación, un mapa del sitio) claros, consistentes, lógicos y estructurados.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(185,'Los mecanismos de navegación están disponibles y visibles en todas las páginas o pantallas del recurso.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(186,'Si el recurso se compone de varias páginas o pantallas existe una de “inicio” donde se muestra un gráfico o un texto con el título del recurso.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(187,'El menú está estructurado para una consulta rápida de los contenidos.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(188,'Si el menú cuenta con muchas opciones, se utilizan subniveles para subordinar la información existente.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(189,'Las funciones de navegación del recurso no entran en conflicto de nombre, icono o función con los botones estándar de navegación de Internet.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(190,'El recurso cuenta con indicadores que ayudan al usuario a  conocer en todo momento el lugar donde se encuentra dentro del recurso, de dónde viene y hacía dónde pude dirigirse, al igual que las diferentes formas de llegar a un punto.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(191,'Los indicadores de ubicación están en un lugar específico y constante en todas las secciones del recurso.','2016-04-05 13:20:22','2018-05-08 16:26:26'),(192,'Las imágenes incluyen el atributo ALT (texto alternativo) que describe en breves palabras el contenido de la imagen (esta etiqueta no se visualiza en todos los navegadores de Internet).','2016-04-05 13:20:23','2018-05-08 16:26:26'),(193,'Cuando un archivo de video es de un tamaño mayor a 50Mb, no se incluye dentro de los archivos en la plataforma, aparece como enlace para verlo bajo demanda (video streaming) en una ventana emergente.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(194,'En recursos desarrollados como página Web, los videos están en formato MP4 y tienen controles de reproducción propios de la etiqueta <video> del estándar HTML5.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(195,'Los archivos de video y audio no se reproducen automáticamente al abrir la página, sino mediante la acción del botón de reproducción.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(196,'En recursos desarrollados como página Web, los archivos de audio están en formato MP3 a 64 kbps. (mínimo) y 128 kbps. (máximo) y se reproducen mediante la barra de control de la etiqueta <audio> del estándar HTML5.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(197,'Los textos de las ligas a archivos descargables están a renglón seguido.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(198,'Los nombres de los archivos descargables son consistentes con su contenido, pero respetan la nomenclatura (en minúsculas, sin espacios, ni acentos, etc.).','2016-04-05 13:20:23','2018-05-08 16:26:26'),(199,'Todos los banners y plecas tienen un pixel de relleno, sin cortes, para ajustarse a los diferentes tamaños de resolución de pantalla.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(200,'Existe un espacio de por lo menos 10px entre las imágenes y los textos que las rodean.','2016-04-05 13:20:23','2018-05-08 16:26:26'),(201,'Los archivos que integran el recurso no incluyen archivos o carpetas de desarrollo o que no pertenecen a los contenidos útiles del recurso.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(202,'Los archivos contenidos en el recurso no están infectados con virus.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(203,'Utiliza solamente minúsculas y nombres cortos para los archivos, sin acentos, espacios ni caracteres inusuales (como la letra “ñ” o signos). Los nombres de los archivos no empiezan con punto (.) ni contienen el signo de dos puntos (:); los nombres de los archivos tienen menos de 31 caracteres y las carpetas menos de 29. No se utilizan los caracteres: “” / \\ * ¿ ? <> |: reservados a funciones particulares.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(204,'Utiliza valores relativos al especificar el tamaño en los atributos de las hojas de estilo, de tal manera que al cambio de resolución del monitor no se afecta el tamaño de los componentes.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(205,'Los textos en ventanas pop-up respetan la hoja de estilos del recurso.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(206,'Utiliza hojas de estilo (CSS) para controlar la maquetación y la presentación.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(207,'Se evita en lo posible el uso de marcos (frames) en el diseño de la interfaz.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(208,'Se emplean las etiquetas de cabecera (headers) de manera adecuada, es decir,  <H1> para el texto más importante de las páginas (títulos principales) y  de manera consecutiva <H2> y <H3> para títulos, subtítulos de secciones u otras frases a destacar. ','2016-04-05 13:20:24','2018-05-08 16:26:26'),(209,'Todas las páginas HTML mantienen una estructura y uso uniforme en la etiqueta <TITLE> ','2016-04-05 13:20:24','2018-05-08 16:26:26'),(210,'En las ventanas emergentes, la etiqueta <TITLE> describe de manera breve el contenido de la ventana, observando las reglas ortográficas.','2016-04-05 13:20:24','2018-05-08 16:26:26'),(211,'Se hace uso correcto de las cajas de: Referencia: Actividad, Foro, Cuestionario, Importante, Para saber más, etc.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(212,'Las cajas de Referencia, Actividad, Para saber más, Lectura, para resaltar texto Importante, etc.; están debidamente alineadas al centro, o a la izquierda cuando el texto es muy extenso, sin espacios ni cortes.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(213,'En las cajas que hacen referencia a un recurso dentro de plataforma, se omite el enlace a dicho elemento en plataforma dentro de las cajas.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(214,'En cursos en plataforma, los cuestionarios de preguntas de opciones se seleccionan al azar de un conjunto mayor.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(215,'Las fórmulas y ecuaciones están en formato de imagen, debidamente alineados con respecto al texto en HTML.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(216,'Todos los textos en los contenidos HTML, SCORM y en la plataforma Moodle, están en Arial a 1 Em o su equivalente en puntos: Arial 12 y en el caso de títulos su tamaño es de 1.2Ems o su equivalente en puntos: Arial 14.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(217,'Todas las instrucciones y pies de imagen están en Arial a 0.8 Em o su equivalente en puntos: Arial 10.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(218,'Cuando se utilizan imágenes como ligas, está deshabilitado el borde de color azul del hipervínculo alrededor de la imagen, el cual aparece de manera automática en algunos navegadores de Internet.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(219,'Todo el hipertexto interno está habilitado y los elementos de destino están disponibles.','2016-04-05 13:20:25','2018-05-08 16:26:26'),(220,'Los hipervínculos del recurso se identifican claramente del resto del contenido e incluyen una referencia que explica su propósito. ','2016-04-05 13:20:25','2018-05-08 16:26:26'),(221,'Cada enlace de hipertexto lleva directamente al contenido de destino a través de un solo clic.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(222,'El uso del hipertexto es limitado en cada página.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(223,'Si el tamaño de una imagen en una ventana emergente es mayor a 800 X 600 pixeles se encuentra habilitada ya sea la barra de desplazamiento vertical o la barra de desplazamiento horizontal, según corresponda. ','2016-04-05 13:20:26','2018-05-08 16:26:26'),(224,'Las ventanas emergentes o pop-ups tienen un tamaño personalizado, no mayor a 800 X 600 pixeles, sin barras de dirección, de menú ni de herramientas. ','2016-04-05 13:20:26','2018-05-08 16:26:26'),(225,'Los recursos creados como página Web, respetan el ancho máximo de pantalla, de tal manera que no se generan barras de desplazamiento adicionales a las del navegador de Internet.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(226,'Los componentes que integran el recurso se encuentran ubicados dentro de un margen imaginario de 745 x 415 px (safe area).','2016-04-05 13:20:26','2018-05-08 16:26:26'),(227,'Todos los elementos (textos, imágenes, animaciones, etc.) son visibles y se muestran sin distorsión en resolución de pantalla de 800 X 600 pixeles.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(228,'El tamaño del menú es el adecuado para ser ubicado y manejado con facilidad, sin que compita visualmente con el resto de los componentes del recurso.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(229,'El elemento de mayor relevancia se encuentra ubicado en la parte superior izquierda, siguiendo con una continuidad jerárquica que va descendiendo en grado de acuerdo con su importancia.','2016-04-05 13:20:26','2018-05-08 16:26:26'),(230,'Los elementos se combinan sin romper el reticulado y las alineaciones básicas, para dar variedad visual y frescura al diseño (sangrías).','2016-04-05 13:20:26','2018-05-08 16:26:26'),(231,'El recurso muestra un equilibrio de pesos visuales, dando una sensación de orden. La alineación de los textos e imágenes se ve organizada y equilibrada en la pantalla, sin amontonamiento o dejando espacios en blanco demasiado amplios.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(232,'Se conserva una identidad de diseño gráfico en todo el recurso (un estilo de presentación que sea consistente en todas las páginas). ','2016-04-05 13:20:27','2018-05-08 16:26:26'),(233,'Las imágenes (incluyendo logotipos, botones e iconografía) tienen un tamaño proporcionado y adecuado al diseño de la interfaz.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(234,'Las combinaciones de los colores de fondo y primer plano tienen el suficiente contraste para ser vistas por personas con problemas visuales.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(235,'Se evita el empleo de contrastes de color saturados (colores brillantes).','2016-04-05 13:20:27','2018-05-08 16:26:26'),(236,'Los colores de estado “nuevo”, “over” y “visitado” del hipervínculo son de diferentes colores, uniformes en todo el recurso, de preferencia utilizando la misma gama de colores del diseño.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(237,'Incluye etiquetas en CD  y/o caja, con un diseño gráfico consistente con el del recurso, que incluye el título del recurso y nombre(s) del o los autores.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(238,'La fuente empleada pertenece a las familias sans-serif (Arial, Helvética, Tahoma, Verdana).','2016-04-05 13:20:27','2018-05-08 16:26:26'),(239,'Al trabajar con texto, se utilizan dos estilos de letra cuando mucho, uno para la lectura y otro para los cabezales.','2016-04-05 13:20:27','2018-05-08 16:26:26'),(240,'Los títulos, subtítulos y contenidos están jerarquizados de una manera uniforme en relación con su color, tamaño y estilo de fuente (altas, bajas, negritas y cursivas).','2016-04-05 13:20:28','2018-05-08 16:26:26'),(241,'El formato de las imágenes incluidas en el recurso es GIF, JPEG, JPG y/o PNG.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(242,'Las imágenes, animaciones y videos son acordes con el texto que las antecede.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(243,'Los elementos multimedia (gráficos, fotografías, animaciones, videos, audio), tienen una adecuada calidad técnica y estética.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(244,'Los recursos gráficos no se ven pixeleados ni se encuentran distorsionados de su tamaño original.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(245,'Todos los mapas de contenidos y tablas tienen un diseño uniforme y acorde con la identidad gráfica del recurso.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(246,'Si por el tamaño de una imagen se requiere habilitar ambas barras de desplazamiento, la imagen NO se presenta como pop-up, sino como archivo PDF en ventana emergente.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(247,'Los formatos empleados en las animaciones son: GIF’s animados y/o SWF.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(248,'Los archivos PDF están protegidos con contraseña para que no puedan ser modificados por el usuario y se permite su impresión a resolución baja.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(249,'Los archivos PDF están optimizados para la web.','2016-04-05 13:20:28','2018-05-08 16:26:26'),(250,'Todos los archivos descargables (PDF, Word, PowerPoint, Excel, etc.) y las páginas de Internet externas a los contenidos del recurso se abren en una ventana nueva.','2016-04-05 13:20:29','2018-05-08 16:26:26'),(251,' En las presentaciones en PowerPoint se utilizan fuentes tipo Arial (sin patines) de manera jerárquica: 32pts. (títulos), 28 pts. (subtítulos) y 24 pts. (contenidos). ','2016-04-05 13:20:29','2018-05-08 16:26:26'),(252,' En las presentaciones en PowerPoint se utilizan fondos que contrasten con el texto para que puedan leerse con claridad. ','2016-04-05 13:20:29','2018-05-08 16:26:26'),(253,' En las presentaciones en PowerPoint se mantienen los criterios gráficos en todas las presentaciones del recurso.','2016-04-05 13:20:29','2018-05-08 16:26:26'),(254,' Las presentaciones en PowerPoint no contienen textos demasiado extensos. No se utiliza este formato para presentar solamente texto. Cada diapositiva incluye 10 renglones de texto o menos. ','2016-04-05 13:20:29','2018-05-08 16:26:26'),(255,' En las presentaciones en PowerPoint no se invaden los bordes del recuadro de la diapositiva con imágenes ni texto (existe un margen imaginario de 2.5% en los cuatro márgenes de la diapositiva). ','2016-04-05 13:20:29','2018-05-08 16:26:26'),(256,' En las presentaciones en PowerPoint las gráficas o imágenes son claras y visibles y no se forza el aumento de su tamaño original.','2016-04-05 13:20:29','2018-05-08 16:26:26'),(257,'Los archivos PowerPoint están publicados como PPS (presentación).','2016-04-05 13:20:29','2018-05-08 16:26:26'),(258,'Todos los archivos descargables de producción propia (PDF, Word, PowerPoint, Excel, etc.) tienen tratamiento de diseño gráfico, imágenes optimizadas y tooltips habilitados para las definiciones de glosario.','2016-04-05 13:20:29','2018-05-08 16:26:26'),(259,'Las imágenes de gran dimensión están cortadas en secciones (mapeo) para optimizar su peso y velocidad de descarga.','2016-04-05 13:20:29','2018-05-08 16:26:26'),(260,'La iconografía empleada se comprende sin previa experiencia computacional y su función se puede deducir de manera intuitiva o en su defecto se acompaña de textos que aclaran su significado.','2016-04-05 13:20:30','2018-05-08 16:26:26'),(261,'La iconografía del recurso es uniforme en todas sus secciones y pantallas.','2016-04-05 13:20:30','2018-05-08 16:26:26');
